      videoId: "o5KPpxjpGh4",


    }
  ];

  const ProjectItem = ({ project }) => (
    <div className="bg-white rounded-lg overflow-hidden transition-transform duration-300 hover:scale-[1.02] mb-8">
      <div className="md:flex h-[400px]">
        <div className="md:w-2/3">
          <div className="ytembed w-full">
            <iframe
              className="w-full h-full"
              src={`https://www.youtube.com/embed/${project.videoId}`}
              title={project.title}
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
              referrerpolicy="strict-origin-when-cross-origin"
              frameborder="0"
              allowFullScreen
            />
          </div>
        </div>
        <div className="md:w-2/3 p-6">
          <h2 className="protitle font-cairo font-bold text-gray-800 mb-3">{project.title}</h2>
          <p className="pro-desctiption text-gray-600 text-xl font-cairo">{project.description}</p>
        </div>
      </div>
    </div>
  );

  return (
    <div className="pro-container min-h-screen mt-14 bg-gray-100 py-12">
      <div className="mx-auto px-8 sm:px-16 md:px-24 lg:px-32 xl:px-40 max-w-[1920px]">
        <h1 className="pro-heading font-semibold font-cairo text-gray-800">Our Projects</h1>
        <div className="space-y-8">
          {projects.map((project) => (
            <ProjectItem key={project.id} project={project} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default ProjectsPage;
